import React from "react";
import "./index.css";

const Skills = () => {
  return (
    <>
      <div className="cotainer d-flex">
        <div class="card" style={{"width": "18rem"}}>
        <i class="fa-brands fa-html5 d-inline-block"></i>
        </div>
      </div>
    </>
  );
};

export default Skills;
